import React from 'react';
const Api = ({consumir, perfiles, onChange, form}) =>(
    <div className="principal">
        <div className="container-form">
            <div className="form-group mb-3">
                <label htmlFor="nombre" className="form-label">Nombre</label>
                <input required onChange={onChange} value={form.nombre} type="text" className="form-control" name="nombre" id="nombre" placeholder="Nombre Apellido" />
                <button onClick={consumir} className="btn btn-success">Consumir</button>
            </div>
        </div>
        <div className="principal mt-3">
            {
                perfiles.map(
                    (item, i) => (
                        <div class="card">
                            <div class="card-body">
                                <img src={item.avatar_url} alt="Perfil" height="80" weight="80"/>
                                <a target="_blank" rel="noreferrer" href={item.html_url} key={i}>{item.login}</a>
                            </div>
                        </div>
                    )
                )
            }
            </div>
    </div>
);

export default Api;
